import PageTemplate from "../templates/Template";
import BusesTable from "./BusesTable";
import BusesGrid from "./BusesGrid";
import React from "react";
import Grid from "@material-ui/core/Grid";
import DashCard from "../dashboard/DashboardCard";

const BusesPage = (props) => {

    // just for UI test for now. 
    const cards = [
        "first",
        "second",
        "third",
        "fourth",
        "five",
        "buses",
        "company"
    ]


    return(
    <PageTemplate title="Buses List">
        {/* <BusesTable/> */}
        
        <Grid container direction="row"  justify="center" alignItems="center">
            {
                cards.map((_, i) => {
                    return <DashCard pagename={cards[i]}/>
                })
            }
        </Grid>
    </PageTemplate>)
}
export default BusesPage;
